	this.instance.setTransform(847.6,337.5);

	this.timeline.addTween(cjs.Tween.get(this.instance).wait(1));

	// enemy
	this.instance_1 = new lib.Enemy();
	this.instance_1.setTransform(1107.9,320.3);

	this.timeline.addTween(cjs.Tween.get(this.instance_1).wait(1));

	// hero
	this.instance_2 = new lib.Hero();
	this.instance_2.setTransform(228.3,166.3);

	this.timeline.addTween(cjs.Tween.get(this.instance_2).wait(1));

